import React, { useEffect } from 'react'
import api  from '../api'

function Pessoa() {
  useEffect(()=>{
    (async ()=>{
      const {data} = await api.get('/pessoa');
      console.log('data pessoa é: ',data)
    })()
  },[])
  return (
    <div>
      <h1>Pessoa</h1>
    </div>
  )
}

export default Pessoa
